package com.highstreets.user.models;import com.google.gson.annotations.SerializedName;public class recently_booked_model {    @SerializedName("booking_id")    private String BookingID;    @SerializedName("merchant_id")    private String MerchantID;    @SerializedName("business_name")    private String BussinessName;    @SerializedName("city")    private String CityName;    @SerializedName("image")    private String ImageThumbnail;    @SerializedName("offer_percentage")    private String OfferPercentage;    @SerializedName("mrp_price")    private String MRP_Price;    @SerializedName("offer_price")    private String OfferPrice;    public String getBookingID() {        return BookingID;    }    public void setBookingID(String bookingID) {        BookingID = bookingID;    }    public String getMerchantID() {        return MerchantID;    }    public void setMerchantID(String merchantID) {        MerchantID = merchantID;    }    public String getBussinessName() {        return BussinessName;    }    public void setBussinessName(String bussinessName) {        BussinessName = bussinessName;    }    public String getCityName() {        return CityName;    }    public void setCityName(String cityName) {        CityName = cityName;    }    public String getImageThumbnail() {        return ImageThumbnail;    }    public void setImageThumbnail(String imageThumbnail) {        ImageThumbnail = imageThumbnail;    }    public String getOfferPercentage() {        return OfferPercentage;    }    public void setOfferPercentage(String offerPercentage) {        OfferPercentage = offerPercentage;    }    public String getMRP_Price() {        return MRP_Price;    }    public void setMRP_Price(String MRP_Price) {        this.MRP_Price = MRP_Price;    }    public String getOfferPrice() {        return OfferPrice;    }    public void setOfferPrice(String offerPrice) {        OfferPrice = offerPrice;    }}